"use strict";function loadDoc(){var n=new XMLHttpRequest;n.onload=function(){this.readyState==4&&this.status==200&&(document.getElementById("demo").innerHTML=this.responseText)};n.open("GET","Content/txt/TextFile1.txt",!0);n.send()}function loadXML(){const n=new XMLHttpRequest;n.onload=function(){const i=this.responseXML,t=i.getElementsByTagName("ARTIST");let n="";for(let i=0;i<t.length;i++)n=n+t[i].childNodes[0].nodeValue+"<br>";document.getElementById("demo").innerHTML=n};n.open("GET","Content/txt/XMLFile1.xml");n.send()}let end=5;$("#searchInput").on("keydown",function(){var i=$(this).val().toLowerCase();let n=$(".product-name"),t=Object.keys(n);t.forEach(function(r,u){u<t.length-2&&n[u].textContent.toLowerCase().includes(i)&&console.log(`Search found ${n[u].textContent}`)});console.log("--------------")});$("#btnViewMore").click(function(){end+=5;let n=window.location.href+"home/fetchData/"+end;$.get(n,{end},function(n){console.log(n);$(".grid-container").append(n)})});